import Signup from './components/pages/Signup';

function App() {
  return (

   <BrowserRouter>
   <Routes>
   <Route path='/' element={<Home/>}></Route>
   <Route path='/signup' element={<Signup/>}></Route>
   <Route path='/signin' element={<Signin/>}></Route>

   </Routes>
   </BrowserRouter>
  );
}

export default App;
